TrendOverTime_2.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";q = filter q by 'Agent_AGENCY_NAME' == "Levin Insurance Agency";result = group q by ('commencement_Year', 'commencement_Month');
result = foreach result generate q.'commencement_Year' as 'commencement_Year', q.'commencement_Month' as 'commencement_Month', {{cell(static_1.selection, 0, "value").asObject()}} as 'A';
result = fill result by (dateCols=('commencement_Year','commencement_Month',"Y-M"));
result = timeseries result generate A as B with (dateCols=('commencement_Year','commencement_Month',"Y-M"), length=5, seasonality=4, model="multiplicative", ignoreLast=true);
result = foreach result generate 'commencement_Year' + "~~~" + 'commencement_Month' as 'commencement_Year~~~commencement_Month', A as 'A', B as 'B';
result = foreach result generate 'commencement_Year~~~commencement_Month', 'A', 'B', coalesce(A,B) as 'C';
result = order result by ('commencement_Year~~~commencement_Month' asc);
result = limit result 2000;

Insurance_PRODUCT_NA_1.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";
result = group q by ('Insurance_PRODUCT_FAMILY');
result = foreach result generate q.'Insurance_PRODUCT_FAMILY' as 'Insurance_PRODUCT_FAMILY',first( q.'Insurance_ProductImageUrl') as 'Insurance_ProductImageUrl', sum(q.'written_base_premium') as 'A', avg(q.'TERM_LENGTH') as 'B';
result = foreach result generate 'Insurance_PRODUCT_FAMILY', 'Insurance_ProductImageUrl', 'A', 'B', round((round(B/(365/2),1)*2),0)/2 as 'C';
result = order result by ('A' desc);
result = limit result 2000;

Agent_AGENCY_NAME_1.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";
q = group q by 'Agent_AGENT_NAME';
q = foreach q generate 'Agent_AGENT_NAME' as 'Agent_AGENT_NAME', sum('written_base_premium') as 'sum_written_base_premium', first('AgentPhoto') as 'first_AgentPhoto';
q = order q by 'sum_written_base_premium' desc;
